import React from 'react'
import {Link} from 'react-router-dom'

export default function NavBar() {
  return (
    <div className="flex w-full h-24 justify-end items-center">
      <Link className="mx-4 text-xl text-black text-bold" to="/">Home</Link>
      <Link className="mx-4 text-xl text-black text-bold" to="/projects">Projects</Link>
      <Link className="mx-4 text-xl text-black text-bold" to="#articles">Articles</Link>
      <Link className="mx-4 text-xl text-black text-bold" to="#contact">Contact</Link>
    </div>
  )
}
